import loginImage from '../images/app-store.png';
import './App.css';

class Login extends Component {
	render() {
		return (
			<div className="login">
				<img src={loginImage} />
				<br/>
				<button className="btn btn-primary">Text goes here</button>
			</div>
		)
	}
}

export default Login
